import React from "react";

const Input = ({ type, id, placeholder }) => {
  return (
    <input
      type={type}
      id={id}
      placeholder={placeholder}
      className="w-full px-4 py-2 border rounded focus:outline-none focus:ring focus:ring-blue-300"
    />
  );
};

export default Input;
